import React from "react";
import './App.css';
import {BrowserRouter as Router, Route, Switch } from "react-router-dom";
import NavBar from './navbar';


function App() {
  return (
    <Router>
    <div className="App">
      <NavBar></NavBar>
    </div>
    </Router>
  );
}

export default App;
